Bienvenidos a la aplicación móvil de la autogestión de Accord Salud, un plan superador de la Obra Social Unión Personal.


En Accord Salud avanzamos contigo y para ti, acercando la Prepaga de Salud al alcance de tus manos.



Desde esta App podrás llevar tu credencial digital contigo a donde vayas. Será util con los prestadores en Centros Propios, prestadores de cartillas, farmacias, y en fin, en todos nuestros servicios. La credencial digital será aceptada tal como si fuese la credencial plástica.



Desde la aplicación podrás mantener tus datos personales actualizados, y acceder a la lista de teléfonos de emergencias. 



Con esta nueva app podrás realizar una serie de trámites desde la palma de tus manos, sin necesidad de acercarte a una agencia de gestión. Contarás con servicios tales como: 
- Buscar farmacias, sanatorios, profesionales por nombre, o especialidad; 
- Acceder a la cartilla general; 
- Seleccionar los prestadores favoritos para tener un rápido acceso a ellos como si fuese una agenda de contactos;  
- Visualizar el estado de los reintegros solicitados;
- Solicitar turnos en sanatorios propios, recetas médicas online, autorizaciones de órdenes médicas;
- Acceder y descargar tus estudios de imágenes y laboratorio; 
- Visualizar el estado de tu facturación y Boletas de Pago;
- y mucho mas.


Accord Salud, a tus manos!
